import React from 'react';

function LandingAbout(props) {
    return (
        <div className="about">

            <div dangerouslySetInnerHTML={{ __html: props.partnerAbout.replace(/href/g, "target='_blank' href") }} />


        </div>
    )
}

export default LandingAbout;
